import React, { Component } from 'react';
import Menu from './partials/Menu';

class Configuracoes extends Component {
    render() {
        return (
            <div className="dashboard">
                <Menu ativo="configuracoes" />
                <h1>Olá, mundo!</h1>
            </div>
        )
    }
}

export default Configuracoes;
